[[package]]
name = "agate"
version = "1.6.3"
description = "A data analysis library that is optimized for humans instead of machines."
category = "main"
optional = true
python-versions = "*"

[package.dependencies]
Babel = ">=2.0"
isodate = ">=0.5.4"
leather = ">=0.3.2"
parsedatetime = ">=2.1,<2.5 || >2.5,<2.6 || >2.6"
python-slugify = ">=1.2.1"
