[[package]]
name = "botocore-stubs"
version = "1.28.5"
description = "Type annotations and code completion for botocore"
category = "main"
optional = false
python-versions = ">=3.7,<4.0"

[package.dependencies]
types-awscrt = "*"

[[package]]
name = "cachetools"
version = "4.2.4"
description = "Extensible memoizing collections and decorators"
category = "main"
optional = true
python-versions = "~=3.5"

[[package]]
